import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header style={headerStyle}>
      <nav style={navStyle}>
        <Link to="/login" style={linkStyle}>Авторизация</Link>
        <Link to="/" style={linkStyle}>Ипотека</Link>
        <Link to="/auto-loan" style={linkStyle}>Автокредит</Link>
        <Link to="/admin" style={linkStyle}>Админ Панель</Link>
      </nav>
    </header>
  );
};

const headerStyle = {
  background: '#007BFF',
  padding: '10px',
  color: 'white',
  textAlign: 'center',
};

const navStyle = {
  display: 'flex',
  justifyContent: 'center',
  gap: '20px',
};

const linkStyle = {
  color: 'white',
  textDecoration: 'none',
  fontWeight: 'bold',
};

export default Header;
